### Analysis

I updated to the latest version of HomeBridge the other day and then updated to the latest version of the UI, since then I have been getting errors.  This is not exactly stopping Homebridge from running, but it is causing problems as it keeps restarting.  

### Expected Behavior

Not to have this error

### Steps To Reproduce

Start Homebridge

