### Additional Context

I am using this image: https://registry.hub.docker.com/r/oznu/homebridge/

Hello, 

In our environment, we cannot make websocket connection in aspnetcore signalR application hosted in IIS (InProcess) and behind reverse proxy (NGINX). 
The TCP connection is reset from IIS (or something else) and the protocol cannot be upgraded to proxy and client receives 502
Bad Gateway, then signalR fallbacks to eventStream. 
Here is the TCP dump.

![TCPDump](https://user-images.githubusercontent.com/4629857/118268867-a0d88200-b4c6-11eb-8728-dd5f1d32cc55.png)

Here is detailed info for our environment: 
AspnetCore SignalR application is hosted in IIS(in process)
dotnet --info: 
  Version: 5.0.4
  Commit:  f27d337295
IP: 192.168.8.100

The reverse proxy is NGINX hosted in Red Hat Enterprise Linux 8.3 - IP: 192.168.8.101
here is the NGINX configuration 

```
http {
    map $http_connection $connection_upgrade {
        "~*Upgrade" $http_connection;
        default keep-alive;
    }
}

server {
    listen       443 ssl http2;

    root         /usr/share/nginx/html;

    error_log /var/log/nginx/error.log warn;

    # Load configuration files for the default server block.
    include /etc/nginx/default.d/*.conf;

    location /DashboardHub {

        proxy_cache off;
        proxy_buffering off;
        proxy_read_timeout 100s;
	proxy_set_header Host $host;
	proxy_pass http://upstream80;
        proxy_set_header Upgrade $http_upgrade;
        proxy_set_header Connection $connection_upgrade;
        proxy_set_header X-Forwarded-For $proxy_add_x_forwarded_for;
        proxy_set_header X-Forwarded-Proto $scheme;
    }

    location / {
    	proxy_set_header X-ClientCert $ssl_client_escaped_cert;
        proxy_set_header Host $host;
	proxy_set_header X-Real-IP $remote_addr;
        proxy_set_header X-Forwarded-For $proxy_add_x_forwarded_for;
        proxy_set_header X-Forwarded-Proto $scheme;
	proxy_set_header Connection "";
    	proxy_pass http://upstream80;
    	proxy_redirect off;
	client_max_body_size 12M;
	proxy_http_version 1.1;
    }

}
```

What I have tried so far: 

1. If we connect to the application directly to IIS from browser everything is working as expected. The app is opening web socket connection and everything is ok. 
2. If we direct the browser through NGINX the app is working, but the browser cannot open websocket connection and the HTTP  status is 502. It then fallbacks to SSE. 
3. If we forward the traffic from NGINX directly to kestrel (start the application as console app) skipping IIS it is also working. 

I have turned FRT in IIS and there is something strange: 
68. GENERAL_RESPONSE_HEADERS Headers="Upgrade: websocket
Server: Microsoft-IIS/10.0
Sec-WebSocket-Accept: rdM3H8k1KPmD/f8HhyLCIw4vpng=
Connection: Upgrade
" 11:49:07.650 

69. GENERAL_FLUSH_RESPONSE_END BytesSent="0", ErrorCode="The parameter is incorrect.
 (0x80070057)" 11:49:07.650 

70. ANCM_INPROC_REQUEST_DISCONNECT  11:49:07.650 

71. GENERAL_READ_ENTITY_START  11:49:07.650 

72. GENERAL_READ_ENTITY_END BytesReceived="0", ErrorCode="The specified network name is no longer available.
 (0x80070040)" 

here is complete tcpdump file with two dumps from Failed Request Tracing. One with the failing request from the proxy, and one from a working one.
[Data.zip](https://github.com/dotnet/aspnetcore/files/6478780/Data.zip)


Thank you !

### Description

Am not able to execute a `TokenCreateTransaction` via the `LocalWallet`.

Consistently getting
```
PrecheckStatusError: transaction @ failed precheck with status INVALID_EXPIRATION_TIME
```
exceptions.

> Note: We came across this issue while running [one of our Strato tests]() against the `develop`s ([commit]( `LocalWallet` implementation.

### Steps to reproduce

Run a modified [`examples` code]( to use a `TokenCreateTransaction` instead:
```js
import { LocalWallet, TokenCreateTransaction } from @hashgraph;

import dotenv from dotenv;

();

async function main() {
    const wallet = new LocalWallet();

    let transaction = await new TokenCreateTransaction()
        .setTokenName(ffff)
        .setTokenSymbol(F)
        .setDecimals(3)
        .setInitialSupply(100)
        .setTreasuryAccountId()
        .setAdminKey()
        .setFreezeKey()
        .setWipeKey()
        .setKycKey()
        .setSupplyKey()
        .setFreezeDefault(false)
        .freezeWithSigner(wallet);

    transaction = await (wallet);
    const response = await (wallet);
    const receipt = await ().waitForReceipt(response);

    (`status: ${()}`);
}

void main();
```
via `node examples` (with `.env` properly set)

### Additional context

Full thrown Error:
