### Context

Kolibri 0.12.5
Ubuntu 18.04

Somewhere between versions 1.13 and the current commit in master (7cc826c9e55af33aee11165a425155e4f8cc2ae1) the StatefulSet resource lost these attributes in metadata:

```
resource_version
self_link
uid
```
I tested this on kubernetes provider versions 1.13 and master, and found those fields missing. This is the acceptance test that brought it to my attention:

```
=== RUN   TestAccKubernetesStatefulSet_basic
    resource_kubernetes_stateful_set_test.go:19: Step 1/2 error: Check failed: 3 errors occurred:
                * Check 4/37 error: kubernetes_stateful_set.test: Attribute 'metadata.0.resource_version' expected to be set
                * Check 5/37 error: kubernetes_stateful_set.test: Attribute 'metadata.0.self_link' expected to be set
                * Check 6/37 error: kubernetes_stateful_set.test: Attribute 'metadata.0.uid' expected to be set
```

I also compared with the Deployment resource, and Deployment still contains metadata.0.uid, resource_version, self_link. So offhand I think this might just be affecting StatefulSet. If it affects other resources, we'll probably see in the acceptance tests.


