**Issue Description** - During synthesis and build job execution time, we require to do vpc lookup as under 
const sharedVpc = (this, `SharedVpc-${name}`, {
          vpcName: sharedVpcName,
        });

For that I need to do authentication into my target AWS environment via OIDC, I can very well add a pre-build steps to Authenticate via OIDC and Assume role using awscredentials step action in my cdk code, but as the permissions set at job level dont provide any id token write access, and neither I am able to extend job level structure in my cdk code so it will help if we can add this id-token write permission in the jobForBuildStep function

**Error** - [Error at ] Could not assume role in target account using current credentials (which are for account ****) User: arn:aws:sts:::assumed-role************ is not authorized to perform: sts:AssumeRole on resource: arn:aws:iam:::role . Please make sure that this role exists in the account. If it doesnt exist, (re)-bootstrap the environment with the right --trust, using the latest version of the CDK CLI.

**Analysis done so far and potential fix** - There is a need to Authenticate via OIDC and Assume role during Synthesis in order to perform cdk look ups. The current permissions at job level for Synthesis ?  : 

Once this is done, I added a pre build step to my synth as under and it fixed the issue.

```ts
private stepToAssumeLookUpRole(env:Environment): [] {
    return [awsCredentialStep(Authenticate Via OIDC Role, {
      region:  ?? ap-southeast-2,
      gitHubActionRoleArn: ,
    }), awsCredentialStep(Assume CDK Lookup Role, {
      region:   ?? ap-southeast-2,
      accessKeyId: ${{  }},
      secretAccessKey: ${{  }},
      sessionToken: ${{  }},
      roleToAssume: arn:aws:iam::++:role
    })
    ];
  }
